    false,nt"url": null,nt"notes": "This annual narrative report for Bear River
    Migratory Bird Refuge outlines Refuge accomplishments during the 1984 calendar year.
    The report begins with a summary of the year's highlights and weather conditions.
    The report includes a planning section which discusses the research and investigations.
    Refuge administration is outlined; information about personnel, funding, and safety
    is given. Habitat management is also covered; subjects include wetlands, forests,
    grasslands, grazing, and pest control. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, migratory birds, game mammals,
    fisheries resources, surplus animal disposal, scientific collections, animal control,
    marking and bird banding, and disease prevention and control. The public uses of
    the Refuge described in this report include outdoor classrooms, interpretive programs,
    recreational uses, and law enforcement. The equipment and facilities section of
    the report provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, communication systems, and energy conservation. Cooperative
    programs and items of interest are provided at the end. Photographs are attached.",nt"owner_org":
